import React from 'react';
import icon from '../../assets/pix-icon.svg';

class PiXIcon extends React.Component<Props, State> {

  constructor(props: any) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.state = { 
      isNavPanelOpen: false
      //state
    };
  }

  public toggle() {
    alert('test');
    let screenWidth = window.screen.width;
    let innerWidth = window.innerWidth;
    if(screenWidth<1200 || innerWidth<1200){
      this.setState((prevState) => {
        return {
          isNavPanelOpen: !prevState.isNavPanelOpen
        }
      });
    }
    else{
      window.location.href = '/';
    }
  }

  public render(){
    return (
      <React.Fragment>
        <header className="PiXIcon">
          <div className="PiXIcon-Component">
            <img className="PiX-Icon" src={icon} alt="icon"/>
          </div>
        </header>
      </React.Fragment>
    )
  }
}

type MyProps = {
  // onClick: () => any;
};

type State = {
  isNavPanelOpen: boolean;
  isFeedbackOpen: boolean;
};

type Props = MyProps;

export default PiXIcon;
